import React from "react";
import arrow from "../images/Path 786.svg";

const Ingredients = ({title}) => {
  return (
    <div className="mt-3 flex flex-col gap-2">
      <div className="flex gap-3">
        <h2 className="font-bold text-sm">{title} (05)</h2>
        <img src={arrow} alt="" />
      </div>

      <div className="flex flex-col gap-2">
        <div className="flex justify-between">
          <p className="text-xs">Cauliflower</p>
          <span className="text-xs">02pc</span>
        </div>
        <div className="flex justify-between">
          <p className="text-xs">Tomato</p>
          <span className="text-xs">02pc</span>
        </div>
        <div className="flex justify-between">
          <p className="text-xs">Spinach</p>
          <span className="text-xs">1/2Kg</span>
        </div>
      </div>
    </div>
  );
};

export default Ingredients;
